import React, { Component } from "react";

import { Row, Col, Card, Button, Icon, Progress } from "antd";

import ChartHistoryGroupColumn from "./React";
const DataSet = require("@antv/data-set");




const sourceDataDaily = [
  {
    name: "Recieved",
    "1AM": 18.9,
    "2AM": 28.8,
    "3AM": 39.3,

  },
  {
    name: "Sent",
    "1AM": 90.9,
    "2AM": 71.8,
    "3AM": 99.3,

  }
];

class BankPersonal extends Component {
  constructor(props) {
    super(props);
    this.state = {
      chartData: [],
      selectedKey: "daily"
    };

  }
  componentDidMount() {
    const dv = new DataSet.View().source(sourceDataDaily);
    dv.transform({
      type: "fold",
      fields: ["1AM","2AM","3AM"],
      key: "keySelect",
      value: "average"
    });
    const data = dv.rows;
    this.setState({ chartData: data, selectedKey: "daily" });
  }



  render() {
    return (
      <div>
        <div className="page-header">
          <p> {this.props.data}  </p>
        </div>
      </div>
    );
  }
}
export default BankPersonal;
